import React, { useState } from 'react';

const DoctorRegistrationForm = () => {
  const [formData, setFormData] = useState({
    email: '',
    fullname: '',
    areaOfInterest: '',
    availableDays: [],
    availableHours: { start: '', end: '' },
    address: '',
    city: '',
    town: '',
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleCheckboxChange = (day) => {
    const updatedDays = formData.availableDays.includes(day)
      ? formData.availableDays.filter((d) => d !== day)
      : [...formData.availableDays, day];
    setFormData({ ...formData, availableDays: updatedDays });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form Data Submitted:', formData);
    // Backend API çağrısı burada yapılacak
  };

  return (
    <div className="p-6 max-w-lg mx-auto bg-white rounded shadow-lg">
      <h2 className="text-2xl font-bold mb-4">Add Me as Doctor</h2>
      <button className="bg-blue-500 text-white px-4 py-2 rounded mb-4 w-full">
        Authenticate with Google
      </button>

      <form onSubmit={handleSubmit}>
        <div className="mb-4">
          <label className="block font-semibold mb-2">Email:</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleInputChange}
            className="w-full p-2 border rounded"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block font-semibold mb-2">Fullname:</label>
          <input
            type="text"
            name="fullname"
            value={formData.fullname}
            onChange={handleInputChange}
            className="w-full p-2 border rounded"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block font-semibold mb-2">Area of Interest:</label>
          <select
            name="areaOfInterest"
            value={formData.areaOfInterest}
            onChange={handleInputChange}
            className="w-full p-2 border rounded"
          >
            <option value="">Select</option>
            <option value="Orthopedics">Orthopedics</option>
            <option value="Pediatrics">Pediatrics</option>
            <option value="Cardiology">Cardiology</option>
          </select>
        </div>

        <div className="mb-4">
          <label className="block font-semibold mb-2">Available Days:</label>
          <div className="flex flex-wrap gap-2">
            {['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'].map((day) => (
              <label key={day} className="flex items-center space-x-2">
                <input
                  type="checkbox"
                  onChange={() => handleCheckboxChange(day)}
                  checked={formData.availableDays.includes(day)}
                />
                <span>{day}</span>
              </label>
            ))}
          </div>
        </div>

        <div className="mb-4">
          <label className="block font-semibold mb-2">Available Hours:</label>
          <div className="flex space-x-2">
            <input
              type="time"
              name="start"
              value={formData.availableHours.start}
              onChange={(e) =>
                setFormData({
                  ...formData,
                  availableHours: { ...formData.availableHours, start: e.target.value },
                })
              }
              className="w-full p-2 border rounded"
            />
            <input
              type="time"
              name="end"
              value={formData.availableHours.end}
              onChange={(e) =>
                setFormData({
                  ...formData,
                  availableHours: { ...formData.availableHours, end: e.target.value },
                })
              }
              className="w-full p-2 border rounded"
            />
          </div>
        </div>

        <div className="mb-4">
          <label className="block font-semibold mb-2">Address:</label>
          <textarea
            name="address"
            value={formData.address}
            onChange={handleInputChange}
            className="w-full p-2 border rounded"
          />
        </div>

        <div className="mb-4">
          <label className="block font-semibold mb-2">City:</label>
          <input
            type="text"
            name="city"
            value={formData.city}
            onChange={handleInputChange}
            className="w-full p-2 border rounded"
          />
        </div>

        <div className="mb-4">
          <label className="block font-semibold mb-2">Town:</label>
          <input
            type="text"
            name="town"
            value={formData.town}
            onChange={handleInputChange}
            className="w-full p-2 border rounded"
          />
        </div>

        <button
          type="submit"
          className="bg-green-500 text-white px-4 py-2 rounded w-full"
        >
          Register
        </button>
      </form>
    </div>
  );
};

export default DoctorRegistrationForm;
